import React, { useState } from 'react';
import FileStructure from './FileStructure';
import 'bootstrap/dist/css/bootstrap.min.css';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Modal, Button } from 'react-bootstrap';

function HomePage() {
    const [activeDiv, setActiveDiv] = useState(null);
    const [showModal, setShowModal] = useState(false);

    const handleIconClick = (type) => {
        setActiveDiv(type);
        setShowModal(true);
    };

    const handleCloseModal = () => {
        setShowModal(false);
    };

    const palleteIconClasses = ['fas fa-plus', 'fa-regular fa-folder', 'fas fa-play', 'fa-solid fa-pause', 'fa-solid fa-xmark'];
    const colors = ['#05a4db', '#cac000', '#88d500', '#dba405', '#fa2e00'];
    const types = ['Status', 'Setup', 'Namelists', 'Output', 'Plots']; // Corresponding types for each icon

    const palatteIcon = (iconClass, color, type) => {
        return (
            <div className='palatte-icon' onClick={() => handleIconClick(type)}>
                <a className='palatte-icon d-flex justify-content-center align-items-center' href="#" style={{ textDecoration: 'none', paddingTop: '10px' }}>
                    <span style={{ fontSize: '30px', color: color }} className={iconClass}></span>
                </a>
                <hr />
            </div>
        );
    };

    const renderModalContent = () => {
        switch (activeDiv) {
            case 'Status':
                return (
                    <div>
                        <div>
                            <label>Job Path:</label>
                            <input type="text" className="form-control" />
                        </div>
                        <div>
                            <label>Job Status:</label>
                            <input type="text" className="form-control" />
                        </div>
                        <div>
                            <label>Run Length:</label>
                            <input type="text" className="form-control" />
                        </div>
                    </div>
                );
            case 'Setup':
                return <div>Setup Content</div>;
            case 'Namelists':
                return <div>Namelists Content</div>;
            case 'Output':
                return <div>Output Content</div>;
            case 'Plots':
                return <div>Plots Content</div>;
            default:
                return null;
        }
    };

    return (
        <>
            <div>
                <p className="top-text">Job</p>
                <div className="parent" style={{ position: 'relative' }}>
                    <div className="palatte-area">
                        <FileStructure />
                    </div>
                    <div className='content-area'>
                        <div className='icons'>
                            {
                                palleteIconClasses.map((iconClass, index) => (
                                    <div key={index}>
                                        {palatteIcon(iconClass, colors[index], types[index])}
                                    </div>
                                ))
                            }
                        </div>
                    </div>
                </div>
            </div>

            <Modal show={showModal} onHide={handleCloseModal}>
                <Modal.Header closeButton>
                    <Modal.Title>{activeDiv} Input</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    {renderModalContent()}
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleCloseModal}>
                        Close
                    </Button>
                    <Button variant="primary" onClick={handleCloseModal}>
                        Save Changes
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
}

export default HomePage;
